import{_ as n,o,c as i,z as e,a as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 16.1-297 Final judgment; copy filed with juvenile court; proceeding may be remanded to juvenile court.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-297.md","filePath":"vacode/16.1-297.md"}'),r={name:"vacode/16.1-297.md"},a=e("h1",{id:"§-16-1-297-final-judgment-copy-filed-with-juvenile-court-proceeding-may-be-remanded-to-juvenile-court",tabindex:"-1"},[t("§ 16.1-297 Final judgment; copy filed with juvenile court; proceeding may be remanded to juvenile court. "),e("a",{class:"header-anchor",href:"#§-16-1-297-final-judgment-copy-filed-with-juvenile-court-proceeding-may-be-remanded-to-juvenile-court","aria-label":'Permalink to "§ 16.1-297 Final judgment; copy filed with juvenile court; proceeding may be remanded to juvenile court."'},"​")],-1),c=e("p",null,"Upon the rendition of final judgment upon an appeal from the juvenile and domestic relations district court, the circuit court shall cause a copy of its judgment to be filed with the juvenile court within twenty-one days of entry of its order, which shall thereupon become the judgment of the juvenile court. In the event such circuit court does not dismiss the proceedings or discharge such child or adult, the circuit court may remand the child or adult to the jurisdiction of the juvenile court for its supervision and care, under the terms of its order or judgment, and thereafter such child or adult shall be and remain under the jurisdiction of the juvenile court in the same manner as if such court had rendered the judgment in the first instance.",-1),d=e("p",null,[t("Code 1950, § 16.1-215; 1956, c. 555; 1977, c. 559; 1996, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0828",target:"_blank",rel:"noreferrer"},"828"),t(".")],-1),u=[a,c,d];function l(s,h,m,f,p,j){return o(),i("div",null,u)}const _=n(r,[["render",l]]);export{g as __pageData,_ as default};
